function draw(){ctx.fillStyle="black",ctx.fillRect(0,0,500,500);for(var t=0;t<snakeArray.length;t++)snakeArray[t].update(),snakeArray[t].draw()}console.log("main.js loaded");for(var myCanvas=document.getElementById("myCanvas"),ctx=myCanvas.getContext("2d"),Snake=function(){this.easing=.23,this.easing1=.0575,this.size=20,this.xPos=[],this.yPos=[],this.targetX=250,this.targetY=250,this.speed=30;for(var t=0;20>t;t++)this.xPos.push(250),this.yPos.push(250);this.update=function(){this.targetX+=this.speed*(Math.random(1)-.5),this.targetY+=this.speed*(Math.random(1)-.5),this.xPos[0]+=(this.targetX-this.xPos[0])*this.easing1,this.yPos[0]+=(this.targetY-this.yPos[0])*this.easing1;for(var t=19;t>0;t--)this.xPos[t]+=(this.xPos[t-1]-this.xPos[t])*this.easing,this.yPos[t]+=(this.yPos[t-1]-this.yPos[t])*this.easing},this.draw=function(){ctx.fillStyle="lime";for(var t=0;20>t;t++)ctx.beginPath(),ctx.arc(this.xPos[t],this.yPos[t],this.size*(1-.04*t),0*Math.PI,2*Math.PI),ctx.closePath(),ctx.fill()}},snakeArray=[],i=0;10>i;i++)snakeArray.push(new Snake);setInterval(draw,33);